import React from "react";
import PropTypes from "prop-types";


const HobbyList = (props) => {
    const { hobbyList } = props;
    return (
        <ul>
            {hobbyList.map((item, index) => (
                <li key={index}>{item}</li>
            ))}
        </ul>
    );
};

HobbyList.propTypes = {
    hobbyList: PropTypes.array,
};
HobbyList.defaultProps = {
    hobbyList: [],
};
export default HobbyList;
